Doctorow's subsequent novels would further refine his unique depiction of the history of New York City and the United States as a whole. 
                Loon Lake (1980) is the story of a young man who cast adrift during the Depression years; 
                World's Fair (1986) is a memoir of a 1930s New York City boyhood; and 
                Billy Bathgate (1989) explores the underground of gangsterism and crime. 
                Loon Lake was a main selection of the Book-of-the-Month Club and was nominated for the National Book Award; 
                World's Fair was the winner of the 1986 National Book Award; 
                Billy Bathgate was the winner of the 1990 P.E.N./Faulkner Award and was adapted into a movie by Tom Stoppard directed by Robert Benton. These books were followed by 
                The Waterworks (1994), an 1870s Manhattan mystery, and 
                City of God (2000), a spiritual quest set at the turn of the 20th Century, and 
                The March (2005), a fictionalized depiction of Sherman’s March to the Sea. The latter won the 2006 PEN/Faulkner Award, the 2005 National Book Critics Award, and was a finalist for the 2006 Pulitzer Prize and the 2005 National Book Award.
